import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, RouterProvider } from "react-router-dom";
import "./index.css";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(

  <BrowserRouter>
  <RouterProvider>
    <App />
  </RouterProvider>

  </BrowserRouter>

);
